import { createRouter, createWebHistory } from 'vue-router'

//引入布局组件
import Layout from '../views/Layout/index.vue'
const routes = [
  {
    path: '/',
    name: 'Login',
    hidden: true,
    meta: {
      name: '登录'
    },
    //按需加载
    component: () => import('../views/Login.vue')
  },
  {
    path: '/:catchAll(.*)',
    name: '404',
    hidden: true,
    meta: {
      name: '404页面'
    },
    //按需加载
    component: () => import('../views/404/404.vue')
  },


  {
    path: '/equipment',
    name: 'equipment',
    //重定向
    meta: {
      name: '医疗器械管理',
      icon: 'School'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/equipment',
        name: 'equipment',
        meta: {
          name: '器械管理',
        },
        component: () => import('../views/Admin/equipment.vue')
      },
    ]
  },
  {
    path: '/carousel',
    name: 'department',
    //重定向
    meta: {
      name: '器械类型管理',
      icon: 'Notebook'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/department',
        name: 'department',
        meta: {
          name: '器械类型管理',
        },
        component: () => import('../views/Admin/type.vue')
      },
    ]
  },
  {
    path: '/carousel',
    name: 'user',
    //重定向
    meta: {
      name: '用户管理',
      icon: 'User'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/user',
        name: 'user',
        meta: {
          name: '用户信息',
        },
        component: () => import('../views/Admin/user.vue')
      },
    ]
  },
  {
    path: '/carousel',
    name: 'workplan',
    //重定向
    meta: {
      name: '收藏',
      icon: 'Operation'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/workplan',
        name: 'workplan',
        meta: {
          name: '收藏',
        },
        component: () => import('../views/Admin/collect.vue')
      },
    ]
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})


export default router
